【適合箇所・個数】<br>
フットランプ：2個<br>
グローブボックス：1個<br>
コンソール：フロント3個・リア1個<br>
ドアイルミ：-<hr>
【特徴】<br>純正交換タイプだから、加工いらずで簡単取付け可能！<br>カラーも豊富な4種類からお選び頂けます。<hr>【カラー】<br>マルチカラー・オレンジ<hr>【サイズ(約)】<br>35.5mm×13mm×11mm<hr>【ご注意】<br>1個の価格になります。<br>純正交換タイプとなっております。<br>グレードによっては装着できない場合がございます。<br>必ず、取り付け箇所をご確認の上、必要個数をご購入下さい。<br>







<style type="text/css">

/***買い物かごまわり全ボタン・入力欄共通***/
input#normal_basket_10009841,input#normal_basket_10014922,input#normal_basket_10023802,normal_basket_10026828,normal_basket_10026855,normal_basket_10026661,normal_basket_10023647,normal_basket_10026632 {
width: 252px;
height: 52px;
white-space: nowrap;
text-indent: 110%;
overflow: hidden;
background:url(http://www.rakuten.ne.jp/gold/auc-cb-if/img/cartbutton.jpg) no-repeat;
border:none;
}

/***「個数」部分***/
input#units{
border:solid #ccc 1px;
background:#fff;
width:30px;
